#include <gtest/gtest.h>

#include <algorithm>
#include <unordered_map>
#include <vector>

#include "test_case_helper.hpp"

class Solution {
  public:
  int findMaxLength(std::vector<int>& nums) {
    std::unordered_map<int, int> indices;
    int best = 0;
    int ones = 0;
    int zeros = 0;
    indices[0] = -1;
    for (int i = 0; i < nums.size(); i++) {
      ones += nums[i] == 1 ? 1 : 0;
      zeros += nums[i] == 0 ? 1 : 0;
      int diff = ones - zeros;
      if (indices.contains(diff)) {
        best = std::max(best, i - indices[diff]);
      } else {
        indices[diff] = i;
      }
    }
    return best;
  }
};

struct TestVec {
  std::vector<int> input;
  int expected;
};

class ParamTest : public ::testing::TestWithParam<TestVec> {};

TEST_P(ParamTest, minSteps) {
  auto tv = GetParam();

  const auto actual = Solution().findMaxLength(tv.input);

  EXPECT_EQ(actual, tv.expected);
}

